import './App.css';
import React from 'react';
import { connect } from 'react-redux';
import Header from './Components/Header.js';
import NavigationBar from './Components/NavigationBar';
import Services from './Components/Services';
import GalleryCarousel from './Components/GalleryCarousel';
import HowToFindUs from './Components/HowToFindUs';
import NewsCarousel from './Components/NewsCarousel';
import StaffMainMenu from './Components/StaffMainMenu';
import Booking from './Components/UnauthenticatedMainMenu/Booking/Booking';

class App extends React.PureComponent {
  render() {
    if (this.props.employeeToken === '') {
      if (this.props.bookingInProcess && this.props.activePage === '') {
        return (
          <div className="App">
            <Header />
            <NavigationBar />
            <div className="main">
              <div className="main_window">
                <div className="mainPage">
                  <Booking />
                </div>
              </div>
            </div>
          </div>
        );
      } else if (!this.props.bookingInProcess && this.props.activePage === '') {
        return (
          <div className="App">
            <Header />
            <NavigationBar />
            <div className="main">
              <div className="main_window">
                <div className="carousels">
                  <div className="mainPage">
                    <HowToFindUs />
                  </div>
                </div>
              </div>
            </div>
          </div>
        );
      } else if (
        !this.props.bookingInProcess &&
        this.props.activePage === 'feedbacksPage'
      ) {
        return (
          <div className="App">
            <Header />
            <NavigationBar />
            <div className="main">
              <div className="main_window">
                <div className="carousels">
                  <div className="mainPage">
                    <HowToFindUs />
                  </div>
                </div>
              </div>
            </div>
          </div>
        );
      } else if (
        !this.props.bookingInProcess &&
        this.props.activePage === 'servicesPage'
      ) {
        return (
          <div className="App">
            <Header />
            <NavigationBar />
            <div className="main">
              <div className="main_window">
                <div className="carousels">
                  <div className="mainPage">
                    <HowToFindUs />
                  </div>
                </div>
              </div>
            </div>
          </div>
        );
      } else if (
        !this.props.bookingInProcess &&
        this.props.activePage === 'employeesPage'
      ) {
        return (
          <div className="App">
            <Header />
            <NavigationBar />
            <div className="main">
              <div className="main_window">
                <div className="carousels">
                  <div className="mainPage">
                    <HowToFindUs />
                  </div>
                </div>
              </div>
            </div>
          </div>
        );
      }
    }
    if (this.props.employeeToken !== '') {
      return (
        <div className="App">
          <Header />
          <NavigationBar />
          <div className="main">
            <div className="main_window">
              <div className="mainPage">
                <StaffMainMenu />
              </div>
            </div>
          </div>
        </div>
      );
    }
  }
}

function mapStateToProps(state) {
  return {
    employeeToken: state.employeeToken,
    responseDataList: state.responseDataList,
    singleResponseData: state.singleResponseData,
    bookingInProcess: state.bookingInProcess,
    actibePage: state.activePage,
  };
}

function mapDispatchToProps(dispatch) {
  return {};
}

export default connect(mapStateToProps, mapDispatchToProps)(App);

